import React, { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import Header from "../components/Header";
import Footer from "../components/Footer";
import { supabase } from "../services/supabase";

const OrderCompletedPage = () => {
  const { orderNumber } = useParams();
  const [order, setOrder] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    loadOrder();
  }, [orderNumber]);

  const loadOrder = async () => {
    const { data, error } = await supabase
      .from("orders")
      .select("*")
      .eq("order_number", orderNumber)
      .single();

    if (error || !data) {
      alert("Order not found");
      navigate("/my-orders");
      return;
    }

    setOrder(data);
    setLoading(false);
  };

  const handleDownload = () => {
    if (order.humanized_file_url) {
      window.open(order.humanized_file_url, "_blank");
    }
  };

  const handleCopyText = () => {
    if (order.humanized_text) {
      navigator.clipboard.writeText(order.humanized_text);
      alert("Text copied to clipboard!");
    }
  };

  const styles = {
    page: {
      minHeight: "100vh",
      display: "flex",
      flexDirection: "column",
    },
    container: {
      maxWidth: "900px",
      margin: "3rem auto",
      padding: "0 2rem",
      flexGrow: 1,
    },
    card: {
      background: "white",
      borderRadius: "16px",
      padding: "3rem",
      boxShadow: "0 8px 24px rgba(0,0,0,0.1)",
    },
    header: {
      textAlign: "center",
      marginBottom: "2rem",
    },
    icon: {
      fontSize: "4rem",
      marginBottom: "1rem",
    },
    title: {
      fontSize: "2.5rem",
      color: "#27ae60",
      marginBottom: "0.5rem",
    },
    orderNumber: {
      fontSize: "1.2rem",
      color: "#6b7e85",
    },
    section: {
      marginTop: "2rem",
      paddingTop: "2rem",
      borderTop: "2px solid #f0f0f0",
    },
    sectionTitle: {
      fontSize: "1.3rem",
      fontWeight: "700",
      color: "#5A3A79",
      marginBottom: "1rem",
    },
    textBox: {
      background: "#f9f9f9",
      padding: "1.5rem",
      borderRadius: "8px",
      border: "1px solid #e0e0e0",
      fontFamily: "monospace",
      fontSize: "0.95rem",
      lineHeight: "1.8",
      maxHeight: "400px",
      overflowY: "auto",
      whiteSpace: "pre-wrap",
      wordWrap: "break-word",
    },
    actions: {
      display: "flex",
      gap: "1rem",
      marginTop: "1.5rem",
    },
    button: {
      padding: "1rem 2rem",
      borderRadius: "8px",
      fontSize: "1rem",
      fontWeight: "700",
      cursor: "pointer",
      border: "none",
      transition: "all 0.3s",
      flex: 1,
    },
    downloadBtn: {
      background: "#27ae60",
      color: "white",
    },
    copyBtn: {
      background: "#6B4A8A",
      color: "white",
    },
    backBtn: {
      background: "#e0e0e0",
      color: "#404c50",
    },
    emptyState: {
      textAlign: "center",
      padding: "3rem",
      color: "#6b7e85",
    },
  };

  if (loading) {
    return (
      <div style={styles.page}>
        <Header />
        <div style={styles.container}>
          <p
            style={{
              textAlign: "center",
              fontSize: "1.2rem",
              color: "#6b7e85",
            }}
          >
            Loading order...
          </p>
        </div>
        <Footer />
      </div>
    );
  }

  return (
    <div style={styles.page}>
      <Header />

      <div style={styles.container}>
        <div style={styles.card}>
          <div style={styles.header}>
            <div style={styles.icon}>‚úÖ</div>
            <h1 style={styles.title}>Order Complete!</h1>
            <p style={styles.orderNumber}>Order #{order.order_number}</p>
          </div>

          {/* Humanized Text */}
          {order.humanized_text && (
            <div style={styles.section}>
              <h2 style={styles.sectionTitle}>üìù Humanized Content</h2>
              <div style={styles.textBox}>{order.humanized_text}</div>
              <div style={styles.actions}>
                <button
                  style={{ ...styles.button, ...styles.copyBtn }}
                  onClick={handleCopyText}
                >
                  üìã Copy Text
                </button>
              </div>
            </div>
          )}

          {/* Download File */}
          {order.humanized_file_url && (
            <div style={styles.section}>
              <h2 style={styles.sectionTitle}>üìÑ Download Document</h2>
              <div style={styles.actions}>
                <button
                  style={{ ...styles.button, ...styles.downloadBtn }}
                  onClick={handleDownload}
                >
                  ‚¨áÔ∏è Download File
                </button>
              </div>
            </div>
          )}

          {/* No Content */}
          {!order.humanized_text && !order.humanized_file_url && (
            <div style={styles.emptyState}>
              <p>No content available yet. Please contact support.</p>
            </div>
          )}

          {/* Back Button */}
          <div style={styles.section}>
            <button
              style={{ ...styles.button, ...styles.backBtn }}
              onClick={() => navigate("/my-orders")}
            >
              ‚Üê Back to My Orders
            </button>
          </div>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default OrderCompletedPage;
